INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/Micro-SD-128GB/SanDisk 128 GB Extreme microSDXC.webp;', 'SanDisk 128 GB Extreme microSDXC', 'https://www.amazon.de/SanDisk-microSDXC-Karte-SD-Adapter-RescuePRO-Performance/dp/B09X7DNF6G/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=14Y5J1RCAFW56&keywords=SanDisk+128+GB+Extreme+microSDXC&qid=1667221573&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=sandisk+128+gb+e%2Caps%2C89&sr=8-4', '26,99', 4.7, 453, 0, 'SanDisk;5 g;Nein;Micro SDXC;San-Disk;128 GB;Die SanDisk Extreme PRO microSDXC ist ideal geeignet für alle Android Smartphones und Tablets, sowie Drohnen oder Actioncams|Für eine bessere App- Performance und schnelleres Laden sorgt die microSD Karte durch den vorhandenen A2 Leistungsstandard|Mit einer Lesegeschwindigkeit von 200 MB/s und einer Schreibgeschwindigkeit von 90 MB/s übertragen Sie Ihre Daten extrem schnell dank SanDisk QuickFlow-Technologie|Machen Sie verlustfreie 4K UHD Videoaufzeichnungen dank UHS Speed Klasse 3 (U3) und Video Speed Klasse 30 (V30) mit der microSD Karte für Smartphones|Lieferumfang: SanDisk Extreme PRO microSDXC UHS-I Speicherkarte 128 GB + Adapter &amp; RescuePRO Deluxe (Für Smartphones, Actionkameras oder Drohnen, A2, V30, U3, 200 MB/s Übertragung) 30 Jahre Garantie');
INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/Micro-SD-128GB/Verbatim Premium 128 GB.webp;', 'Verbatim Premium 128 GB', 'https://www.amazon.de/Verbatim-44025-128GB-Class-Speicherkarte/dp/B00CFFFDFA/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1BKJ17QAV27LR&keywords=verbatim+premium+128gb&qid=1667221579&sprefix=%2Caps%2C72&sr=8-4', '22,80', 4.5, 992, 0, 'Verbatim;-;-;SDXC;-;-;128 GB;OPTIMALE AUFLÖSUNG: Die Speicherkarte überzeugt dank Leistungsklasse 10 mit einer Datenübertragsrate von mind. 80 Mbit/s - sie ermöglicht es Ihnen, Full-HD-Videos aufzunehmen.|SCHNELLE ÜBERTRAGUNG: Mit der SD-Karte profitieren Sie von sehr kurzen Übertragungszeiten Ihrer Dateien - dank einer Lesegeschwindigkeit von bis zu 90 MB/s &amp; Schreibgeschwindigkeit von mind. 10 MB/s.|VIELSEITIGE EINSATZGEBIETE: Die SDXC-Speicherkarte ist mit jedem elektronischen Gerät bspw. PC &amp; Kamera kompatibel, dass einen Einschub für die SDHC/SDXC-Speicherkarte besitzt.|PRODUKTDETAILS: Die Speicherkarte von Verbatim ist in den Ausführungen 16 GB , 32 GB , 64 GB, 128 GB und 256 GB erhältlich - sie ist kompatibel mit Kameras &amp; Hostgeräten, die SDXC unterstützen.|Verbatim: Mit unserer jahrelangen Erfahrung stehen wir für genaue &amp; fehlerfreie Datenspeicherung - Unsere Stärken in den Bereichen F&amp;E und Qualitätssicherung garantieren erstklassige Produkte!');
INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Micro-SD-128GB/Netac 128GB MicroSDXC.webp;', 'Netac 128GB MicroSDXC', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo1NDI1MTA3ODA2MDI1NTE5OjE2NjcyMjE1ODQ6c3BfYXRmOjIwMDQyMTk1MjE2MjA0OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FGigastone-MicroSD-UHS-I-Class-Speicherkarte%2Fdp%2FB07LBSBX5L%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D2YW926JGUSQSB%26keywords%3DNetac%2B128GB%2BMicroSDXC%26qid%3D1667221584%26sprefix%3D%252Caps%252C68%26sr%3D8-1-spons%26psc%3D1', '24,99', 4.7, 6918, 0, 'Gigastone;9 g;Micro SDXC;Gigastone;128 GB;[Geschwindigkeit] : Lese- und Schreibgeschwindigkeit von bis zu 100/50 MB/s, V30-Geschwindigkeitsgrad, Ultra HD (UHD) 4K-Videoaufnahme, UHD 4K-Gaming.|[App] : A1-Grade bietet eine schnellere App-Ladeleistung für Smartphone &amp; Tablet.|[Speicher] : Erweitert den internen Speicherplatz des Smartphones. Ermöglicht die Verschiebung/Herunterladung der Apps auf Micro SD-Karte.|[Kompatibilität] : Speichererweiterung für Laptops, Tablets, PCs, Smartphones, Kameras, DSLR, Dashcams, Camcorder, Überwachungskameras, e-Reader, Drohne, Gaming, Dateien, Videos, Musik. Kompatibel mit Nintendo Switch GoPro Android Samsung Canon Nikon.|[Unterstützung] : Gigastone 5 Jahre beschränkte Garantie einschließlich kostenloser Datenwiederherstellung.');
INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Micro-SD-128GB/Amazon Basics  microSDXC 128 GB.webp;', 'Amazon Basics  microSDXC 128 GB', 'https://www.amazon.de/Amazon-Basics-microSDXC-Memory-Adapter/dp/B08TJRVWV1/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1618A1AH3S1ID&keywords=Amazon+Basics+microSDXC+128+GB&qid=1667221590&sprefix=amazon+basics+micro%2Caps%2C80&sr=8-2', '15,99', 4.6, 18469, 0, 'Amazon Basics;0.27 g;-;Micro SDXC;Amazon;128 GB;BREITE KOMPATIBILITÄT: Kompatibel mit Smartphones, Tablets, Kameras, GoPro-/Action-Kameras, Laptops, Desktop-Computern, Spiegelreflexkameras, Drohnen, Nintendo Switch/anderen tragbaren Konsolen und vielem mehr. Mit SD-Adapter|HOCHWERTIGES SPEICHERN: Perfekt für hochauflösende Fotos, zur Aufnahme und zum Speichern von Full HD-/4K-Videos und allen anderen Dateiformaten|ULTRA-SCHNELL: Lesegeschwindigkeit von bis zu 100 Mbit/s. Schreibgeschwindigkeit von bis zu 60 Mbit/s (variiert je nach Speichergröße). Geschwindigkeitsklassen UHS, U3, Klasse 10 und A2 für ein optimales Smartphone-Erlebnis|DAUERHAFTE ZUVERLÄSSIGKEIT: Stoßfest, IPX6-wasserfest, temperaturbeständig (-10° bis 80°&nbsp;C), Röntgenstrahlen- und magnetsicher|Die tatsächliche Speicherkapazität, die vom Betriebssystem Ihres Geräts angezeigt wird, kann aufgrund unterschiedlicher Messstandards geringer sein als die Kapazität, die auf dem Produktetikett angegeben ist.|Die Lese- und Schreibgeschwindigkeiten basieren auf internen Tests, die unter kontrollierten Bedingungen durchgeführt wurden. Die tatsächlichen Geschwindigkeiten können je nach genutztem Gerät, Schnittstelle, Nutzungsbedingungen und anderen Faktoren variieren|Überprüfen Sie, ob Ihr Gerät mit der Kapazität der MicroSD-Karte kompatibel ist. Sollte das Gerät beispielsweise nur eine maximale Kapazität von 64&nbsp;GB unterstützen, erkennt es MicroSD-Karten mit 128&nbsp;GB oder mehr eventuell nicht|Wenn Sie eine Produktversion ohne das A2-Logo erhalten, ist die Leistung immer noch auf A2-Niveau. Wir ändern den Druck und die Verpackung des Produkts, um das A2-Logo aufzunehmen');
INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Micro-SD-128GB/?Kingstick Hochgeschwindigkeits-Micro-Speicherkarte.webp;', '?Kingstick Hochgeschwindigkeits-Micro-Speicherkarte', 'https://www.amazon.de/Micro-SD-Karte-SD-Kartenadapter-Hochgeschwindigkeits-Micro-SD-Flash-Speicherkarte-Telefon-Computer/dp/B0B618HC3W/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2VV0J4HCKXBI4&keywords=%3FKingstick+Hochgeschwindigkeits-Micro-Speicherkarte&qid=1667221596&sprefix=kingstick+hochg%2Caps%2C101&sr=8-3', '19,19', 5.0, 1, 0, 'Kingstick;8 g;Nein;-;-;Kingstick;-;❤ [Anwenden auf]: Ideal für Android-Smartphones, Tablets, Drohnen, Dash-Kameras, Camcorder, hochauflösende Fotos, Spiele, Musik, DSLRs, Fahrrekorder, digitale Spiegelreflexkameras, Überwachungskameras, Sportkameras, Bluetooth-Lautsprecher, VR und Computer und Laptop.|❤ [Beschreibung]: 1 GB = 1.000.000,00 Byte. Aufgrund unterschiedlicher Kapazitätsalgorithmen und Teilkapazitäten werden für Systemdateien, Verwaltung und Leistungsoptimierung verwendet, sodass die tatsächlich verfügbare Kapazität möglicherweise geringer ist als die identifizierende Kapazität.|❤ [High-Speed]: High-Speed der Speicherkartenklasse 10. (Die Leistung kann je nach Hostgerät, Schnittstelle, Nutzungsbedingungen und anderen Faktoren variieren.)|❤ [Zuverlässig und langlebig]: Stoßfest, temperaturbeständig, wasserdicht und röntgensicher.|❤ [Garantie und Service]: Das Produkt bietet eine zweijährige Garantie. Wenn Sie während der Verwendung des Produkts auf produktbezogene Probleme stoßen, wenden Sie sich bitte direkt über Amazon an uns.');
