INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/Micro-SD-128GB/Verbatim Premium 128 GB.webp;', 'Verbatim Premium 128 GB', 'https://www.amazon.de/Verbatim-44025-128GB-Class-Speicherkarte/dp/B00CFFFDFA/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=KY42QJ60549W&keywords=verbatim+premium+128gb&qid=1667645016&qu=eyJxc2MiOiIxLjA5IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C85&sr=8-4', '22,80', 4.5, 991, 0, 'Verbatim;-;-;SDXC;-;-;128 GB;OPTIMALE AUFLÖSUNG: Die Speicherkarte überzeugt dank Leistungsklasse 10 mit einer Datenübertragsrate von mind. 80 Mbit/s - sie ermöglicht es Ihnen, Full-HD-Videos aufzunehmen.|SCHNELLE ÜBERTRAGUNG: Mit der SD-Karte profitieren Sie von sehr kurzen Übertragungszeiten Ihrer Dateien - dank einer Lesegeschwindigkeit von bis zu 90 MB/s &amp; Schreibgeschwindigkeit von mind. 10 MB/s.|VIELSEITIGE EINSATZGEBIETE: Die SDXC-Speicherkarte ist mit jedem elektronischen Gerät bspw. PC &amp; Kamera kompatibel, dass einen Einschub für die SDHC/SDXC-Speicherkarte besitzt.|PRODUKTDETAILS: Die Speicherkarte von Verbatim ist in den Ausführungen 16 GB , 32 GB , 64 GB, 128 GB und 256 GB erhältlich - sie ist kompatibel mit Kameras &amp; Hostgeräten, die SDXC unterstützen.|Verbatim: Mit unserer jahrelangen Erfahrung stehen wir für genaue &amp; fehlerfreie Datenspeicherung - Unsere Stärken in den Bereichen F&amp;E und Qualitätssicherung garantieren erstklassige Produkte!');
INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Micro-SD-128GB/Netac 128GB MicroSDXC.webp;', 'Netac 128GB MicroSDXC', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTozNzc2NzkyNDkwNDg1OTkwOjE2Njc2NDUwMjQ6c3BfYXRmOjIwMDQyMTk1MjE2MjA0OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FGigastone-MicroSD-UHS-I-Class-Speicherkarte%2Fdp%2FB07LBSBX5L%2Fref%3Dsr_1_2_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3DA1YZGS7DN8NO%26keywords%3DNetac%2B128GB%2BMicroSDXC%26qid%3D1667645024%26qu%3DeyJxc2MiOiIxLjE5IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%253D%253D%26sprefix%3D%252Caps%252C64%26sr%3D8-2-spons%26psc%3D1', '24,99', 4.7, 6941, 0, 'Gigastone;9 g;Micro SDXC;Gigastone;128 GB;[Geschwindigkeit] : Lese- und Schreibgeschwindigkeit von bis zu 100/50 MB/s, V30-Geschwindigkeitsgrad, Ultra HD (UHD) 4K-Videoaufnahme, UHD 4K-Gaming.|[App] : A1-Grade bietet eine schnellere App-Ladeleistung für Smartphone &amp; Tablet.|[Speicher] : Erweitert den internen Speicherplatz des Smartphones. Ermöglicht die Verschiebung/Herunterladung der Apps auf Micro SD-Karte.|[Kompatibilität] : Speichererweiterung für Laptops, Tablets, PCs, Smartphones, Kameras, DSLR, Dashcams, Camcorder, Überwachungskameras, e-Reader, Drohne, Gaming, Dateien, Videos, Musik. Kompatibel mit Nintendo Switch GoPro Android Samsung Canon Nikon.|[Unterstützung] : Gigastone 5 Jahre beschränkte Garantie einschließlich kostenloser Datenwiederherstellung.');
INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Micro-SD-128GB/Amazon Basics  microSDXC 128 GB.webp;', 'Amazon Basics  microSDXC 128 GB', 'https://www.amazon.de/Amazon-Basics-microSDXC-Memory-Adapter/dp/B08TJRVWV1/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=395YGPRONKIJZ&keywords=Amazon+Basics+microSDXC+128+GB&qid=1667645033&qu=eyJxc2MiOiIwLjk1IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C82&sr=8-2', '15,99', 4.6, 18730, 0, 'Amazon Basics;0.27 g;-;Micro SDXC;Amazon;128 GB;BREITE KOMPATIBILITÄT: Kompatibel mit Smartphones, Tablets, Kameras, GoPro-/Action-Kameras, Laptops, Desktop-Computern, Spiegelreflexkameras, Drohnen, Nintendo Switch/anderen tragbaren Konsolen und vielem mehr. Mit SD-Adapter|HOCHWERTIGES SPEICHERN: Perfekt für hochauflösende Fotos, zur Aufnahme und zum Speichern von Full HD-/4K-Videos und allen anderen Dateiformaten|ULTRA-SCHNELL: Lesegeschwindigkeit von bis zu 100 Mbit/s. Schreibgeschwindigkeit von bis zu 60 Mbit/s (variiert je nach Speichergröße). Geschwindigkeitsklassen UHS, U3, Klasse 10 und A2 für ein optimales Smartphone-Erlebnis|DAUERHAFTE ZUVERLÄSSIGKEIT: Stoßfest, IPX6-wasserfest, temperaturbeständig (-10° bis 80°&nbsp;C), Röntgenstrahlen- und magnetsicher|Die tatsächliche Speicherkapazität, die vom Betriebssystem Ihres Geräts angezeigt wird, kann aufgrund unterschiedlicher Messstandards geringer sein als die Kapazität, die auf dem Produktetikett angegeben ist.|Die Lese- und Schreibgeschwindigkeiten basieren auf internen Tests, die unter kontrollierten Bedingungen durchgeführt wurden. Die tatsächlichen Geschwindigkeiten können je nach genutztem Gerät, Schnittstelle, Nutzungsbedingungen und anderen Faktoren variieren|Überprüfen Sie, ob Ihr Gerät mit der Kapazität der MicroSD-Karte kompatibel ist. Sollte das Gerät beispielsweise nur eine maximale Kapazität von 64&nbsp;GB unterstützen, erkennt es MicroSD-Karten mit 128&nbsp;GB oder mehr eventuell nicht|Wenn Sie eine Produktversion ohne das A2-Logo erhalten, ist die Leistung immer noch auf A2-Niveau. Wir ändern den Druck und die Verpackung des Produkts, um das A2-Logo aufzunehmen');
INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Micro-SD-128GB/?Kingstick Hochgeschwindigkeits-Micro-Speicherkarte.webp;', '?Kingstick Hochgeschwindigkeits-Micro-Speicherkarte', 'https://www.amazon.de/256GB-Micro-SD-Karte-SD-Kartenadapter-Hochgeschwindigkeits-Micro-SD-Flash-Speicherkarte-Klasse/dp/B0B614MJSL/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1FTTF7WSBNGH3&keywords=%3FKingstick+Hochgeschwindigkeits-Micro-Speicherkarte&qid=1667645042&qu=eyJxc2MiOiIxLjkwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=kingstick+hochges%2Caps%2C106&sr=8-3', '23,99', 2.5, 3, 0, 'Kingstick;20 g;Nein;-;1 GB;Kingstick;256 GB;❤ [Anwenden auf]: Ideal für Android-Smartphones, Tablets, Drohnen, Dash-Kameras, Camcorder, hochauflösende Fotos, Spiele, Musik, DSLRs, Fahrrekorder, digitale Spiegelreflexkameras, Überwachungskameras, Sportkameras, Bluetooth-Lautsprecher, VR und Computer und Laptop.|❤ [Beschreibung]: 1 GB = 1.000.000,00 Byte. Aufgrund unterschiedlicher Kapazitätsalgorithmen und Teilkapazitäten werden für Systemdateien, Verwaltung und Leistungsoptimierung verwendet, sodass die tatsächlich verfügbare Kapazität möglicherweise geringer ist als die identifizierende Kapazität.|❤ [High-Speed]: High-Speed der Speicherkartenklasse 10. (Die Leistung kann je nach Hostgerät, Schnittstelle, Nutzungsbedingungen und anderen Faktoren variieren.)|❤ [Zuverlässig und langlebig]: Stoßfest, temperaturbeständig, wasserdicht und röntgensicher.|❤ [Garantie und Service]: Das Produkt bietet eine zweijährige Garantie. Wenn Sie während der Verwendung des Produkts auf produktbezogene Probleme stoßen, wenden Sie sich bitte direkt über Amazon an uns.');
INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/Micro-SD-128GB/Samsung EVO Select 128GB microSDXC UHS-I U3.webp;', 'Samsung EVO Select 128GB microSDXC UHS-I U3', 'https://www.amazon.de/Samsung-Speicherkarte-SD-Adapter-MB-ME128KA-EU/dp/B09D3N9MFH/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3NB7PHW46D7IA&keywords=Samsung+EVO+Select+128GB+microSDXC+UHS-I+U3&qid=1667645053&qu=eyJxc2MiOiIwLjkxIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=samsung+evo+select+1%2Caps%2C131&sr=8-3', '', 4.7, 8718, 0, 'Samsung;0.26 g;Nein;Micro SDXC;Samsung;128 GB;Auf Geschwindigkeit optimierte microSD Speicherkarte perfekt für den Einsatz in Smartphones, Tablets, 360° Kameras, Full HD Action Kameras und Drohnen|Kompatibel mit Nintendo Switch zur einfachen Verwaltung des Speichers|Hohe Geschwindigkeit: geeignet für 4K UHD- und Super Slow Motion Aufnahmen mit bis zu 130 MB/s Übertragungsgeschwindigkeit (UHS-I U1)|Viel Platz: 256 GB Speicherkapazität für bis zu 12 Stunden Aufnahmezeit von 4K UHD Videos oder 75. 200 Fotos|Hohe Sicherheit für Ihre Daten dank 6-fach Schutz: Wasserfest, temperaturbeständig, röntgensicher, magnetresistent, sturzsicher und verschleißfrei|SD-Adapter: Der mitgelieferte SD-Adapter macht die EVO Select mit einer Reihe von verschiedenen Geräten kompatibel.');
