INSERT INTO `micro-sd-128gb` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (10, '../img/products/Micro-SD-128GB/Kootion TF-128G.webp;', 'Kootion TF-128G', 'https://www.amazon.de/Kootion-Speicherkarte-MicroSDXC-Speicher-Smartphones/dp/B08CGCJDHX/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=YRJLBBQPREEJ&keywords=Kootion+TF-128G&qid=1667645069&qu=eyJxc2MiOiIxLjE5IiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=hama+microsdxc+128gb%2Caps%2C61&sr=8-3', '19,54', 4.4, 2322, 0, 'Kootion;2 g;Nein;Micro SDXC;KOOTION;128 GB;Die 128GB Micro SD Kartes, 128GB MicroSD Speicherkarten, unterstützen die Aufnahme von noch mehr Stunden Full-HD-Video.|Der 128GB Micro SD Karte mit Übertragungsgeschwindigkeit bis zu 80 MB/s, Lesegeschwindigkeit bis zu 20 MB/s.|Die 128GB Micro SD Karte mit UHS-Geschwindigkeitsklasse U1 und Geschwindigkeitsklasse 10 unterstützt die Aufnahme und Wiedergabe von Videos in Full HD.|Die Micro SD-Karte ist ideal für Android Smartphones, Tablets, Digitalkameras, Spielekonsolen, Dash - Kameras, Drohnen und Überwachungssysteme usw.|Qualität und Service - Das paket enthält 1 micro SD karte 128GB und 1 adapter (Bei Fragen senden Sie bitte eine E-Mail)');
